"use client";
import Image from "next/image";
import React, { useState } from "react";

interface imagesProps {
  images: string[];
}

function ImageSection({ images }: imagesProps) {
  // badal images
  const imagesLink = [
    "data:image/jpeg;base64,",
    ,
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    ,
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
  ];
  const [currentImage, setCurrentImage] = useState(0);
  return (
    <div className="flex flex-col space-y-4">
      <div>
        <Image
          loading="lazy"
          src={imagesLink[currentImage] || ""}
          alt="Product Image"
          width={200}
          height={200}
          className="w-full h-[400px] object-cover rounded-lg shadow-lg"
        />
      </div>
      <div className="grid grid-cols-5 md:grid-cols-5 lg:grid-cols-5 gap-4">
        {imagesLink.map((image, index) => {
          return (
            <div key={index}>
              <Image
                loading="lazy"
                alt="index"
                src={image || ""}
                width={200}
                height={200}
                className={`w-full h-[70px] object-cover rounded-lg shadow-lg cursor-pointer ${
                  currentImage === index ? "border-2 border-blue-500" : ""
                }`}
                onClick={() => setCurrentImage(index)}
              />
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default ImageSection;
